import React from "react";
import {FaBars} from "react-icons/fa";
function Navbar(){
    return(
        <>
        <div className="navbar">
            <Link to="*" className='menu-bars'>
                <FaBars/>
            </Link>
        </div>
        </>
    )
}

export default Navbar();
